import React from 'react';
import SearchBooks from './SearchBooks';
import Login from './Login';
import { useNavigate } from 'react-router-dom'; // For navigation

function App() {
  return (
    <div className="App">
      <h1 style={{ textAlign: 'center' }}>Milestone Library</h1>
      <Login />
      <SearchBooks />
    </div>
  );
}

export default App;
